(:~ : Splits a string into matching and non-matching regions : : @author Priscilla Walmsley, Datypic : @version 1.0 : @see http://www.xqueryfunctions.com/xq/functx_get-matches-and-non-matches.html : @param $string the string to split : @param $regex the pattern :)
declare function functx:get-matches-and-non-matches ( $string as xs:string? , $regex as xs:string ) as element()* { 
   let $iomf := functx:index-of-match-first($string, $regex) 
   return if (empty($iomf)) then <non-match>{$string}</non-match> 
          else if ($iomf > 1) 
               then (<non-match>{substring($string,1,$iomf - 1)}</non-match>, 
                     functx:get-matches-and-non-matches( substring($string,$iomf),$regex)) 
               else let $length := string-length($string) - string-length(functx:replace-first($string, $regex,'')) 
                    return (<match>{substring($string,1,$length)}</match>, 
                            if (string-length($string) > $length) 
                            then functx:get-matches-and-non-matches( substring($string,$length + 1),$regex) else ()) 
}

