{
  let $mf := function($k, $v) {
                if ($k eq $key)
                then map{$k : $value}
                else map{$k : local:deep-put($v, $key, $value)}
             }
  for $i in $input
  return
    if ($i instance of map(*))
    then map:merge(map:for-each($i, $mf))
    else if ($i instance of array(*))
    then array{ local:deep-put($i?*, $key, $value) }
    else $i
}

